INSERT INTO `question` (`id_question`, `question`, `status`, `id_chapter`) VALUES
(1, 'Penerbangan perintis membuat waktu tempuh perjalanan ke daerah terpencil menjadi singkat. Salah satu keluhan wisatawan mancanegara dan nusantara, adalah waktu tempuh ke objek wisata ke daerah terpencil melalui jalur darat. Sementara jika melalui jalur udara (menggunakan pesawat), waktu tempuh ke objek wisata hanya sekitar 40 menit. Tidak hanya potensi wisata yang akan terangkat, ketika ada penerbangan perintis, tetapi juga potensi lainnya seperti perikanan. Pernyataan berikut yang sesuai dengan teks di atas adalah ...', 'y', 1),
(2, 'Pikiran positif dapat mernbantu peningkatan kolesterol baik, yang secara tidak langsung melindungi jantung. Selain itu, pikiran positif dapat juga menurunkan kadar molekul lemak. Bahkan, hal tersebut dapat menjaga kualitas tidur. Ditemukan pula bahwa pikiran positif dapat menjauhkan seseorang dari (penyakit) stres. Gagasan utama paragr af di atas adalah ...', 'y', 1),
(3, 'Penggilingan gabah diawali dengan menghidupkan atau meng-on-kan mesin penggiling. Beberapa saat kemudian gabah yang telah dikeringkan dimasukkan ke dalam bak penampung. Setelah itu, penggilingan dimulai dengan membuka katup pembatas antara bak dan bagian mesin. Selanjutnya, hasil penggilingan dimasukkan ke dalam karung atau wadah yang telah disiapkan. Paragraf di atas dikembangkan dengan teknik ...', 'y', 1),
(4, '(1) Taman nasional ini dikenal mempunyai ekosistem yang unik dan vegetasi spesifik.\r\n<br>(2) Taman Nasional Baluran adalah salah satu taman nasional tertua di Indonesia.\r\n<br>(3) Keberadaan sabana menjadi istimewa bagi daerah seperti Indonesia yang mempunyai intensitas curah hujan tinggi.\r\n<br>(4) Keunikan dan kespesifikan itu terlihat pada hewan yang endemik dan Padang sabana.\r\n<br>Kalimat yang tersusun secara acak di atas dapat disusun menjadi paragraf yang baik dengan urutan ....', 'y', 1),
(5, '<p style=\"text-align: left;\">DATA STATTSTIK KECELAKAAN KERJA</p>\r\n<p style=\"text-align: left;\">PERIODE 2010-2014</p>\r\n<p>&nbsp;</p>\r\n<table style=\"width: 365px;\" width=\"302\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 69px; text-align: center;\">\r\n<p>PERIODE TAHUN</p>\r\n</td>\r\n<td style=\"width: 105px; text-align: center;\">\r\n<p>JUMLAH KECELAKAAN</p>\r\n</td>\r\n<td style=\"width: 169px; text-align: center;\">\r\n<p>KLAIM JAMINAN KECELAKAAN KERJA (Rp)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 69px; text-align: center;\">\r\n<p>2010</p>\r\n</td>\r\n<td style=\"width: 105px; text-align: center;\">\r\n<p>83.714</p>\r\n</td>\r\n<td style=\"width: 169px; text-align: center;\">\r\n<p>209,7 miliar</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 69px; text-align: center;\">\r\n<p>2011</p>\r\n</td>\r\n<td style=\"width: 105px; text-align: center;\">\r\n<p>94.736</p>\r\n</td>\r\n<td style=\"width: 169px; text-align: center;\">\r\n<p>297,9 miliar</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 69px; text-align: center;\">\r\n<p>2012</p>\r\n</td>\r\n<td style=\"width: 105px; text-align: center;\">\r\n<p>96.314</p>\r\n</td>\r\n<td style=\"width: 169px; text-align: center;\">\r\n<p>328,5 miliar</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 69px; text-align: center;\">\r\n<p>2013</p>\r\n</td>\r\n<td style=\"width: 105px; text-align: center;\">\r\n<p>98.711</p>\r\n</td>\r\n<td style=\"width: 169px; text-align: center;\">\r\n<p>401,2 miliar</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 69px; text-align: center;\">\r\n<p>2014</p>\r\n</td>\r\n<td style=\"width: 105px; text-align: center;\">\r\n<p>99.491</p>\r\n</td>\r\n<td style=\"width: 169px; text-align: center;\">\r\n<p>504,0 miliar</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\nlnformasi yang sesuai dengan tabel di atas adalah ....', 'y', 1),
(6, 'Untuk menjadi calon presiden pada pemilu 2014, seseorang harus memiliki elektabilitas yang memadai.\r\nMakna elektabilitas pada kalimat di atas adalah ....', 'y', 1),
