(11, 'Sikap saling harga-menghargai di antara sesamanya manusia itu adalah merupakan wujud daripada kemanusiaan yang adil dan beradab.<br>Kalimat mubazir di atas dapat diperbaiki menjadi kalimat yang hemat dengan cara ....', 'Y', 1),
