(19, 'Penulisan kutipan langsung dibawah ini yang benar adalah ....', 'y', 1),
(20, '<em>Hutan Indonesia memiliki keanekaan hayati yang sangat tinggi. Artinya, bahwa pulau-pulau di Indonesia memiliki keanekaragaman tumbuhan, hewan, jasad renik yang tinggi. Hal ini terjadi karena keadaan alam yang berbeda dari satu pulau dengan pulau lainnya; bahkan dari satu tempat dengan tempat dalam satu pulau yang sama.</em><br>\r\n<p><em>Sistem perpaduan antara sumber daya hayati dan tempat hidupnya yang khas itu menumbuhkan berbagai ekosistem. Keragaman itu menampilkan kekhususan kehidupan pula dalam jenis-jenis di dalam. Sebagian besar hutan-hutan di Indonesia termasuk dalam hutan hutan tropis, yang merupakan hutan uang kompleks, yang memiliki pohon berbagai ukuran.</em></p>\r\n<p>(disarikan dari irwantoshut.net/hutan-indonesia)</p>\r\n<p>Judul yang tepat untuk dua paragraf di atas adalah .....</p>', 'Y', 1),
(21, 'Kata-kata dibawah ini manakah yang tidak sesuai?', 'y', 17),
(22, 'Berikut ini adalah kata-kata yang berkonotasi negatif, kecuali …', 'y', 17),
(23, 'Urutan kata yang tidak sesuai adalah …', 'y', 17),
(24, 'Kata-kata dibawah ini merupakan nama-nama ibu kota negar-negara di dunia, kecuali …', 'y', 17),
(25, 'Urutkanlah kata-kata berikut berdasarkan ukuran dari yang terkecil sampai yang terbesar!', 'y', 17),
(26, 'Manakah nama yang tidak termasuk dalam kelompok di bawah ini?', 'y', 17),
(27, 'Matumona membeli jeruk 6 buah, 1 buah dimakan sendiri, 2 buah diberikan kepada Sitorus, dan 2 buah lainnya diberikan kepada Hutabarat. Sitorus memberikan 1 buah jeruk kepada Hutabarat, sedangkan Hutabarat memakan 2 buah jeruknya. Berapakah jeruk milik Sitorus?', 'y', 17),
(28, 'Kata yang tidak sesuai adalah …', 'y', 17),
(29, 'Kata yang tidak sesuai adalah …', 'y', 17),
(30, 'Kata yang di bawah ini adalah kata-kata baku, kecuali …', 'y', 17),
(31, 'Dari kata-kata berikut manakah yang tidak sesuai?', 'y', 17),
(32, 'Manakah penulisan angka tahun romawi yang tidak benar?', 'y', 17),
(33, 'AIDA memerlukan 1.941 menit untuk membaca sebuah makalah. DIFA membutuhkan 4.961 menit dan IDA hanya membaca selama 491 menit. Berapa menit yang dibutuhkan DAFA untuk membaca majalah?', 'y', 17),
(34, 'Sebuah kapal sedang merapat di pelabuhan. Kondisi air laut saat itu turun 2 meter dari biasanya karena sedang surut, sedangkan badan kapal yang berada di dalam air setinggi 2 meter. Menjelang sore, air mulai pasang dan ketinggian air naik 1 meter. Maka ketinggian badan kapal yang ada di air saat itu adalah …', 'y', 17),
(35, 'Perhatikan nama-nama dalam kelompok di bawah ini. Orang-orang dalam kelompok tersebut namanya memiliki beberapa persamaan. Di antara mereka ada seseorang penyusup. Siapakah penyusup tersebut?', 'y', 17),
(36, 'Sitompul memiliki sebuah balok yang isinya 240 cm<sup>3</sup>, Panjang alasnya 8 cm dan lebar 6 cm. berpakah tinggi balok Sitompul tersebut?', 'Y', 18),
(37, 'Nilai ujian Caniago dalam semester III: 7, 5, 7, 6, 9, dan 8. Dan semester IV: 6, 8, 6, 7, 5, 9. Nilai rata-rata semester III dan IV adalah …', 'y', 18),
(38, 'Indrayana mengadakan rapat untuk acara tujuh belasan. Ia mengedarkan undangan untuk 50 wanita dan 70 pria. Ternyata undangan wanita yang hadir 40% dan undangan pria yang hadir 50%, kira-kira berapa persen yang hadir?', 'y', 18),
(39, 'Pardede adalah seorang mahasiswa akuntansi. Dalam suatu ujian, ia memperoleh nilai sebagai berikut:\r\nAkuntansi Keuangan	: 85\r\nBudgeting		: 76\r\nEkonomi			: 77\r\nStatistik Keuangan	: 80\r\nSistem Keuangan		: 84\r\nBerapa nilai mata pelajaran Bahasa Inggris Bisnis yang harus dicapai oleh Pardede jika memiliki target nilai rata-rata sebesar 87?\r\n', 'y', 18),
(40, 'Mahendradata berjualan kue di depan rumahnya. Dia bisa menjual kuenya sebesar Rp 150.000,00. Keuntungan yang diperoleh adalah 20% dari harga pembeliannya. Berapakah  harga pembeliannya?', 'y', 18),
(41, 'Si Poltak mempunyai satu aquarium. Untuk memenuhi aquariumnya sampai penuh diperlukan 12 ember B atau 16 ember A. Jika suatu ketika aquarium itu diisi dengan 12 ember A, berapa ember B lagi yang diperlukan untuk memenuhi aquarium si Poltak tersebut?', 'y', 18),
(42, 'Sinaga akan memberi ubin untuk lantai ruang tamunya. Ruangan tersebut berbentuk bujur sangkar dengan Panjang 4 meter. Ubin yang akan dipasang berukuran 20 x 20 cm. berapakah jumlah ubin yang diperlukan untuk menutup lantai ruang tamu?', 'y', 18),
(43, 'Masyuhara membeli sebuah mini tape dengan harga Rp 100.000,00 kemudian dijualnya kembali. Ia menginginkan laba 25%. Berapa rupiah Masyuhara harus menjual kembali mini tape-nya?', 'y', 18),
(44, 'Silahuddin ingin pergi ke rumah kekasihnya. Ia pergi ke sana mengendarai sebuah sepeda motor yang melaju dengan kecepatan 30 km/jam. Jarak yang ditempuh adalah 90 km. jika ia berangkat pukul 07.00 maka akan sampai pada …', 'y', 18),
(45, 'Jarak rumah Nobita ke supermarket adalah 1 km. Ia bisa menempuh jarak itu selama 20 menit. Berapakah kecepatan berjalan Nobita?', 'y', 18),
(46, 'Nilai dari <img title=\"(\\sqrt{3} -\\sqrt{2})^{2} + (\\sqrt{2} -\\sqrt{3})^{2}\" src=\"http://latex.codecogs.com/gif.latex?(\\sqrt{3}&amp;space;-\\sqrt{2})^{2}&amp;space;+&amp;space;(\\sqrt{2}&amp;space;-\\sqrt{3})^{2}\" />&nbsp;adalah &hellip;', 'Y', 10),
(47, 'Bentuk sederhana dari <img title=\"\\frac{\\sqrt{5}-\\sqrt{6}}{\\sqrt{5}+\\sqrt{6}}\" src=\"http://latex.codecogs.com/gif.latex?\\frac{\\sqrt{5}-\\sqrt{6}}{\\sqrt{5}+\\sqrt{6}}\" />&nbsp;adalah &hellip;', 'Y', 10),
(48, 'Nilai dari r dan s merupakan akar &ndash; akar persamaan kuadrat 2x<sup>2</sup> + 10x + 6 = 0. Nilai dari r<sup>2</sup> + s<sup>2</sup> adalah &hellip;', 'Y', 10),
(49, 'Diketahui fungsi kuadrat f(x) = 3x<sup>2</sup> + 2x &ndash; 1, koordinat titik potong dengan sumbu X dan Y berturut &ndash; turut adalah &hellip;', 'Y', 10),
(50, 'Himpunan penyelesaian yang memenuhi pertidaksamaan 2x &ndash; 2 &lt; x + 3 &lt; 2 &ndash; x adalah &hellip;', 'Y', 10),
(51, 'Fungsi invers dari f(x) = <img title=\"f(x) = \\frac{3x+2}{2x+1}\" src=\"http://latex.codecogs.com/gif.latex?f(x)&amp;space;=&amp;space;\\frac{3x+2}{2x+1}\" />&nbsp;adalah &hellip;', 'Y', 10),
(52, 'Jika <img title=\"\\alpha\" src=\"http://latex.codecogs.com/gif.latex?\\alpha\" />&nbsp;sudut lancip dan <img title=\"tg \\alpha =\\frac{5}{\\sqrt{11}}\" src=\"http://latex.codecogs.com/gif.latex?tg&amp;space;\\alpha&amp;space;=\\frac{5}{\\sqrt{11}}\" />&nbsp;maka <img title=\"cos \\alpha\" src=\"http://latex.codecogs.com/gif.latex?cos&amp;space;\\alpha\" />&nbsp;adalah &hellip;', 'Y', 10),
(53, 'Jika cos<sup>2</sup>x + 4 = a dan 4 &le; a &le; 5 maka nilai dari cosec x adalah &hellip;', 'Y', 10),
(54, 'Dari segitiga ABC dibawah diketahui sudut A = 30&deg;, sudut C = 120&deg; dan panjang BC = 10 cm. Panjang AB adalah &hellip; cm.<br /><img src=\"data:image/jpeg;base64,\" alt=\"\" width=\"278\" height=\"88\" />', 'Y', 10),
(55, 'Jika diketahui matriks A =<img title=\"\\begin{pmatrix} 1 &amp; 0 \\\\ 2 &amp; -1 \\end{pmatrix}\" src=\"http://latex.codecogs.com/gif.latex?\\begin{pmatrix}&amp;space;1&amp;space;&amp;&amp;space;0&amp;space;\\\\&amp;space;2&amp;space;&amp;&amp;space;-1&amp;space;\\end{pmatrix}\" />, B = <img title=\"\\begin{pmatrix} 2 &amp; 1 \\\\ 1 &amp; 3 \\end{pmatrix}\" src=\"http://latex.codecogs.com/gif.latex?\\begin{pmatrix}&amp;space;2&amp;space;&amp;&amp;space;1&amp;space;\\\\&amp;space;1&amp;space;&amp;&amp;space;3&amp;space;\\end{pmatrix}\" />&nbsp;, C = <img title=\"\\begin{pmatrix} 1 &amp; 1 \\\\ 2 &amp; 3 \\end{pmatrix}\" src=\"http://latex.codecogs.com/gif.latex?\\begin{pmatrix}&amp;space;1&amp;space;&amp;&amp;space;1&amp;space;\\\\&amp;space;2&amp;space;&amp;&amp;space;3&amp;space;\\end{pmatrix}\" />&nbsp;maka harga A x B &ndash; C adalah &hellip;', 'Y', 10),
(56, 'Jika diketahui A = <img title=\"\\begin{pmatrix} 5 &amp; 2\\\\ 8 &amp; 3 \\end{pmatrix}\" src=\"http://latex.codecogs.com/gif.latex?\\begin{pmatrix}&amp;space;5&amp;space;&amp;&amp;space;2\\\\&amp;space;8&amp;space;&amp;&amp;space;3&amp;space;\\end{pmatrix}\" />, maka matriks transpose dari matriks invers A<sup>-1</sup> adalah &hellip;', 'Y', 10),
(57, 'Jika <img title=\"\\begin{pmatrix} -1 &amp; 2\\\\ 3 &amp; 2 \\end{pmatrix}\" src=\"http://latex.codecogs.com/gif.latex?\\begin{pmatrix}&amp;space;-1&amp;space;&amp;&amp;space;2\\\\&amp;space;3&amp;space;&amp;&amp;space;2&amp;space;\\end{pmatrix}\" /><img title=\"\\begin{pmatrix} x\\\\ y \\end{pmatrix}\" src=\"http://latex.codecogs.com/gif.latex?\\begin{pmatrix}&amp;space;x\\\\&amp;space;y&amp;space;\\end{pmatrix}\" />&nbsp;= <img title=\"\\begin{pmatrix} -1\\\\ 11 \\end{pmatrix}\" src=\"http://latex.codecogs.com/gif.latex?\\begin{pmatrix}&amp;space;-1\\\\&amp;space;11&amp;space;\\end{pmatrix}\" />&nbsp;maka harga x dan y adalah &hellip;', 'Y', 10),
(58, 'Bila x<sub>1</sub> dan x<sub>2</sub> adalah harga &ndash; harga x yang memenuhi persamaan <sup>5</sup>log<sup>2</sup>x &ndash; <sup>5</sup>logx &ndash; 20 = 0 maka nilai dari x<sub>1</sub>.x<sub>2</sub> adalah &hellip;', 'Y', 10),
(59, 'Jika suatu deret aritmatika diketahui suku ke-4 adalah 26 dan suku ke-9 adalah 61. Maka jumlah 16 suku pertama deret tersebut adalah &hellip;', 'Y', 10),
(60, 'Rata &ndash; rata nilai ujian kelas A yang terdiri dari 30 siswa adalah 85. Setelah kelas A digabungkan dengan kelas B, nilai rata &ndash; rata ujianya menjadi 81. Maka nilai rata &ndash; rata ujian kelas B yang terdiri dari 40 siswa adalah &hellip;', 'Y', 10),
(61, 'Nilai dari <img title=\"\\lim_{x\\rightarrow 3}\\frac{2x^{x}-9x+9}{9-x^{2}}\" src=\"http://latex.codecogs.com/gif.latex?\\lim_{x\\rightarrow&amp;space;3}\\frac{2x^{x}-9x+9}{9-x^{2}}\" />&nbsp;adalah &hellip;', 'Y', 10),
(62, 'Nilai dari <img title=\"\\lim_{x \\rightarrow \\infty} \\left [ \\sqrt{(x+1)(x+2)^2}-x \\right ]\" src=\"http://latex.codecogs.com/gif.latex?\\lim_{x&amp;space;\\rightarrow&amp;space;\\infty}&amp;space;\\left&amp;space;[&amp;space;\\sqrt{(x+1)(x+2)^2}-x&amp;space;\\right&amp;space;]\" />&nbsp;adalah &hellip;', 'Y', 10),
(63, 'Nilai dari <img title=\"\\lim_{x\\rightarrow 0}\\frac{4x^2}{1-cos2x}\" src=\"http://latex.codecogs.com/gif.latex?\\lim_{x\\rightarrow&amp;space;0}\\frac{4x^2}{1-cos2x}\" />&nbsp;adalah &hellip;', 'Y', 10),
(64, 'Turunan pertama fungsi f(x) = 5 x<sup>2/5</sup> adalah <img title=\"f\'(x)\" src=\"http://latex.codecogs.com/gif.latex?f\'(x)\" />&nbsp;. <img title=\"f\'(32)\" src=\"http://latex.codecogs.com/gif.latex?f\'(32)\" />&nbsp;Nilai adalah &hellip;', 'Y', 10),
(65, 'Turunan pertama dari fungsi trigonometri <img title=\"f(x)=sin 5x+\\frac{1}{secx}\" src=\"http://latex.codecogs.com/gif.latex?f(x)=sin&amp;space;5x+\\frac{1}{secx}\" />&nbsp;adalah &hellip;', 'Y', 10),
(66, 'Turunan kedua dari fungsi rigonometri f(x) = 4 sin.cosx adalah &hellip;', 'Y', 10),
(67, 'Persamaan garis singgung pada kurva y = x<sup>2</sup> &ndash; 5x pada titik (1, -4) adalah &hellip;', 'Y', 10),
