(82, '<strong>Question 7-9 are based on the following passage.</strong><br />\r\n<p>The Bermuda Triangle occupies a disturbing and almost unbelievable place in the world&rsquo;s catalog of unexplained mysteries. More than a hundred planes and ship have vanished in this area into the air since 1945, and more than a thousand lives have been lost, without a single body or even a piece wreckage from the vanishing planes or ships having been found.</p>\r\n<p>Many of the planes concerned have vanished while in normal radio contact with their base until the very moment of their disappearance, while others have radioed the most extraordinary messages, implying that they could not get their instruments to function, that their compasses were spinning, that the sky had turned yellow and hazy on a clear day, and the ocean, which was calm nearby, didn&rsquo;t look right without further clarification of what was wrong.<br /><br />The passage mainly deals with&hellip;</p>', 'Y', 7),
