(88, '<p><strong>Question numbers 13-16 refer to this text</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Every second, one hectare of the world&rsquo;s rainforest is destroyed. That&rsquo;s equivalent to two football fields. An area the size of New York City is lost every day. In a year, that adds up to 31 million hectares &ndash; more than the land area of Poland. This alarming rate of destruction has serious consequences for the environment: scientists estimate, for example, that 137 species of plant, insect or animal become extinct every day due to logging. In British Columbia, where, since 1990, thirteen rainforest valleys have been clearcut, 142 species of salmon have already become extinct, and the habitats of grizzly bears, wolves and many other creatures are threatened. Logging, however, provides jobs, profit, taxes for the government and cheap products of all kinds for consumers, so the government is reluctant to redirect or control it.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Much of Canada&rsquo;s forestry production goes towards making pulp and paper. According to the Canadian Pulp and Paper Association, Canada supplies 34% of the world&rsquo;s wood pulp and 49% of its newsprint paper. If these paper products could be produced in some other way, Canadian forests could be preserved. Recently, a possible alternative way of producing paper has suggested by agriculturalist and environmentalists : a plant called hemp.<br /><br />The number of species of salmon that have become extinct in British Columbia was&hellip;</p>', 'Y', 7),
