(158, '<p><strong>Untuk soal nomor 1 - 10.</strong></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"620\">\r\n<p style=\"text-align: center;\"><strong>SOAL DUKU</strong></p>\r\n<ul>\r\n<li>Baskoro memiliki 5 buah duku.</li>\r\n<li>Duku Idayu lebih banyak dari duku Baskoro, tetapi lebih sedikit dari pada duku Aldo.</li>\r\n<li>Duku Prabangkoro yang paling banyak.</li>\r\n<li>Duku Aldo sama banyak dengan duku Supratman.</li>\r\n<li>Selisih duku Supratman dan duku Aryo adalah 3 buah lebih banyak punya Supratman.</li>\r\n<li>Jika duku Aryo dimakan satu akan menjadi sama banyak dengan duku Baskoro.</li>\r\n<li>Selisih duku Prabangkoro dan Supratman ada 10 buah.</li>\r\n<li>Duku Nolin dan duku Aryo jika dijumlahkan akan menjadi 7 buah.</li>\r\n<li>Duku Idayu dan duku Aldo jika dijumlahkan akan menjadi 13.</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Berapa selisih duku Prabangkoro dan Nolin?</p>', 'Y', 24),
