(167, 'Duku siapa saja yang berjumlah Sembilan?', 'y', 24),
(168, '<p><strong>Soal untuk nomor 11 - 13.</strong></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"620\">\r\n<ul>\r\n<li>Linda, Susanti, Opik, Sintia, Daratista, Idayu, Wiwin, Ipung, Srikandini, dan Zahra membentuk group bermain drama.</li>\r\n<li>Tempat untuk bermain drama selalu berpindah-pindah sehingga setiap anak mendapat giliran.</li>\r\n<li>Pembagian giliran tersebut berdasarkan abjad nama masing-masing yang diurutkan dari belakang sehingga Zahra mendapat giliran pertama.</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\nSiapa yang mendapatkan giliran kesembilan?', 'Y', 24),
(169, 'Siapa yang mendapat giliran keempat?', 'Y', 24),
(170, 'Siapa yang mendapatkan giliran ketujuh?', 'Y', 24),
(171, '<p><strong>Soal untuk nomor 14 - 15.</strong></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"620\">\r\n<ul>\r\n<li>Pada saat bermain drama di rumah Daratista, Sintia tidak bisa datang sehingga Susanti datang bersama Linda dan Opik.</li>\r\n<li>Pada saat bermain drama berada di tempat Srikandini, Zahra datang pertama. Opik, Linda, Susanti, dan Sintia menyusul kemudian. Sedangkan yang lain datang lima belas menit sebelum permainan drama dimulai.</li>\r\n<li>Opik, Linda, Susanti, dan Sintia tidak pernah berangkat sendiri-sendiri.</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Ketika bermain drama dirumah Ipung, Susanti tidak bisa berangkat sehingga Linda berangkat bersama siapa saja?</p>', 'Y', 24),
(172, 'Pada saat bermain drama berada di rumah Susanti, Opik berangkat bersama dengan siapa saja?', 'Y', 24);
